import{_ as e,o as a,c as t,O as r}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 46.2-341.26:8 Fees.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-341.26:8.md","filePath":"vacode/46.2-341.26:8.md"}'),o={name:"vacode/46.2-341.26:8.md"},i=r('<h1 id="§-46-2-341-26-8-fees" tabindex="-1">§ 46.2-341.26:8 Fees. <a class="header-anchor" href="#§-46-2-341-26-8-fees" aria-label="Permalink to &quot;§ 46.2-341.26:8 Fees.&quot;">​</a></h1><p>Payment for withdrawing blood shall not exceed $25, which shall be paid out of the appropriation for criminal charges.</p><p>If the person whose blood sample was withdrawn is subsequently convicted for violation of § <a href="http://law.lis.virginia.gov/vacode/46.2-341.24/" target="_blank" rel="noreferrer">46.2-341.24</a> or § <a href="http://law.lis.virginia.gov/vacode/46.2-341.31/" target="_blank" rel="noreferrer">46.2-341.31</a>, any fees paid by the Commonwealth to the person withdrawing the sample shall be taxed as part of the costs of the criminal case and shall be paid into the general fund of the state treasury.</p><p>1992, c. 830; 2003, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0933" target="_blank" rel="noreferrer">933</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0936" target="_blank" rel="noreferrer">936</a>.</p>',4),n=[i];function s(l,c,h,_,d,p){return a(),t("div",null,n)}const m=e(o,[["render",s]]);export{g as __pageData,m as default};
